Scooby-Doo! Mystery Incorporated - Season 1 - Complete
------------------------------------------------------

A sleepy little village, Crystal Cove, boasts a long history of ghost sightings,
poltergeists, demon possession, phantoms and other paranormal occurrences.
The renowned sleuthing team of Fred, Daphne, Velma, Shaggy and Scooby-Doo
arrive to prove all of this simply isn't real - but they don't realize
the locals don't welcome their help.

Produced by Cartoon Network and Warner Bros. Animation.

